import React from 'react';
import { _ViewCans } from '../../stl-cmp';
import search from '../../img/search.svg';
import CardCan from './CardCan'

const ViewCans = () => {

    const ejCan = [{
        "id": 1,
    "name": "Affenpinscher",
    "picture": "https://cdn2.thedogapi.com/images/BJa4kxc4X.jpg",
    "temp": ['Stubborn', 'Curious', 'Playful', 'Adventurous', 'Active', 'Fun-loving'],
    "weight": "3 - 6",
    "height": "23 - 29",
    "yearsOfLife": "10 - 12 years"
    },{
        "id": 2,
        "name": "Afghan Hound",
        "picture": "https://cdn2.thedogapi.com/images/hMyT4CDXR.jpg",
        "temp": ['Aloof', 'Clownish', 'Dignified', 'Independent', 'Happy'],
        "weight": "23 - 27",
        "height": "64 - 69",
        "yearsOfLife": "10 - 13 years"
    }
]

	return (
		<_ViewCans>
			<form>
				<label>
					<p>Busca un Can</p>
					<div>
						<input type="text" />
						<button>
							<object data={search} type="image/svg+xml" />
						</button>
					</div>
				</label>
			</form>
            <div className="Views">
                {
                    ejCan.length!==0?

                        ejCan.map((e)=>{
                            return(
                                <CardCan
                                key={`item-${e.id.toString()}`}
                                id={e.id}
                                name={e.name}
                                picture={e.picture} 
                                temp={e.temp} 
                                weight={e.weight} 
                                height={e.height} 
                                yearsOfLife={e.yearsOfLife}
                                />
                            )
                        })

                    :
                    <p key='nothing' >no hay perros para mostrar.</p>

                }
            </div>
		</_ViewCans>
	);
};

const mapStateToProps=(state)=>{
    return {


    }
}

export default ViewCans;
